import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const FormCart = ({setCartItems}) => {
    const navigative = useNavigate();

    const [formData, setFormData] = useState({
      fullname: "",
      email: "",
      phone_number: "",
      address: "",
      note: "",
      order_date: "",
      status: "",
      total_money: "",
    });
    useEffect(() => {
        const storedCartItems = localStorage.getItem("cartItems") || "[]";
        const parsedCartItems = JSON.parse(storedCartItems);
        setProducts(parsedCartItems);

    }, []);

    const handleChange = (e) => {
      const { name, value } = e.target;
      setFormData((prevData) => ({
        ...prevData,
        [name]: value,
      }));
    };

    const handleSubmit = (e) => {
      e.preventDefault();
      // Thực hiện xử lý logic khi đặt hàng ở đây

      // Kiểm tra validation (đơn giản chỉ là kiểm tra các trường có dữ liệu không)
      if (Object.values(formData).some((field) => field.trim() === "")) {
        // Hiển thị thông báo lỗi nếu có
        alert("Vui lòng nhập đầy đủ thông tin!");
        return;
      }

      // Thực hiện xử lý logic khi đặt hàng ở đây
      console.log("Form submitted with data:", formData);

      // Xóa giỏ hàng và lưu vào localStorage
      setCartItems([]);
      localStorage.removeItem("cartItems");

      // Hiển thị thông báo thành công cho người dùng
      alert("Đặt hàng thành công!");

      // Nếu cần điều hướng sau khi submit, sử dụng useNavigate hoặc Link
      navigative("/");
    };
  return (
    <div className="container">
      <h2>Thông tin đặt hàng</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="fullname">Họ và tên:</label>
          <input
            type="text"
            id="fullname"
            name="fullname"
            className="form-control"
            value={formData.fullname}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            id="email"
            name="email"
            className="form-control"
            value={formData.email}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="phone_number">Số điện thoại:</label>
          <input
            type="text"
            id="phone_number"
            name="phone_number"
            className="form-control"
            value={formData.phone_number}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="address">Địa chỉ giao hàng:</label>
          <textarea
            id="address"
            name="address"
            className="form-control"
            value={formData.address}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="note">Ghi chú:</label>
          <textarea
            id="note"
            name="note"
            className="form-control"
            value={formData.note}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="order_date">Ngày đặt hàng:</label>
          <input
            type="date"
            id="order_date"
            name="order_date"
            className="form-control"
            value={formData.order_date}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="status">Trạng thái:</label>
          <input
            type="text"
            id="status"
            name="status"
            className="form-control"
            value={formData.status}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="total_money">Tổng số tiền:</label>
          <input
            type="text"
            id="total_money"
            name="total_money"
            className="form-control"
            value={formData.total_money}
            onChange={handleChange}
          />
        </div>
        <button type="submit" className="btn btn-primary">
          Đặt hàng
        </button>
      </form>
    </div>
  );
};

export default FormCart;
